		*(a2i__c_buf_p) = (a2i__hold_char);
		YY_CURRENT_BUFFER_LVALUE->a2i__buf_pos = (a2i__c_buf_p);
		YY_CURRENT_BUFFER_LVALUE->a2i__n_chars = (a2i__n_chars);
