/* a2i_lex_destroy is for both reentrant and non-reentrant scanners. */
int a2i_lex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		a2i__delete_buffer( YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		a2i_pop_buffer_state();
	}

	/* Destroy the stack itself. */
	a2i_free((a2i__buffer_stack) );
	(a2i__buffer_stack) = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * a2i_lex() is called, initialization will occur. */
    a2i__init_globals( );

    return 0;
}

